    t.faqs = [{
        id: 1,
        title: "Need help?",
        questions: [{
            id: 1,
            question: "What do I need to play CryptoKitties?",
            answer: "<p>Heres what you need to get started:</p><ul><li>A computer or laptop running the desktop version of Chrome or Firefox</li><li>MetaMask, a digital wallet used specifically with web apps</li><li>Ether, a form of digital payment that powers CryptoKitties</li></ul>"
        }, {
            id: 2,
            question: "Installing MetaMask, your digital wallet",
            answer: '<p>To use CryptoKitties, you will need to install MetaMask, a digital wallet. You will need to put money in it to make your first purchase.</p><p><strong>Note:</strong> A digital wallet like MetaMask acts like a bank accounttreat it with respect and make sure you dont forget your password or the seed words.</p><iframe width="100%" height="315" src="https://www.youtube.com/embed/tfETpi-9ORs?rel=0&amp;showinfo=0" frameborder="0" allowfullscreen></iframe>'
        }, {
            id: 3,
            question: "Why is MetaMask locked?",
            answer: '<p>Occasionally the My Kitties page displays a lock screen. This happens because MetaMask locks your account after a certain period of time automatically. To unlock simply click on the MetaMask extension and type in your password.</p><img src="/images/screenshot-locked.png" />'
        }, {
            id: 4,
            question: "Getting Ether, your digital currency",
            answer: '<p><strong>For U.S. citizens only:</strong> you can buy ether (ETH) in MetaMask. ETH is a digital currency that enables our game to run.</p><img src="/images/screenshot-buy-usa.png" /><p><strong>For everyone else:</strong> you will need to purchase ETH from an exchange. The easiest way is using Coinbase and then transferring the ETH from your Coinbase wallet to your MetaMask wallet. Unfortunately, you cannot play CryptoKitties with a Coinbase wallet or any other wallets.</p><p>You cannot use USD/CAD to buy a CryptoKittycurrencies need to be converted into ETH first.</p>'
        }, {
            id: 5,
            question: "How to send ETH to MetaMask",
            answer: '<p><strong>For U.S. citizens only:</strong> you are able to purchase ETH directly from the MetaMask wallet using the Coinbase widget. This is more convenient and doesnt require you to create two accounts.</p><p><strong>For everyone else:</strong> you need to buy ETH from an exchange using normal fiat currency. Coinbase is the easiest to setup however the choice is ultimately up to you. Copy your MetaMask address but clicking on the ... then Copy Address to clipboard. Go to Coinbase and click Accounts and select your ETH Wallet and then click send. Paste the MetaMask address in the box with the amount youd like to transfer.</p><iframe width="100%" height="315" src="https://www.youtube.com/embed/PtdMDtCVck0?rel=0&amp;showinfo=0" frameborder="0" allowfullscreen></iframe>'
        }, {
            id: 6,
            question: "Why is MetaMask being so slow?",
            answer: "<p>If you have a lot of tabs open, MetaMask will suffer memory leaks and slow down. To fix this issue, close all your tabs, restart the browser, and things should improve.</p>"
        }]
    }, {
        id: 2,
        title: "Understanding CryptoKitties",
        questions: [{
            id: 1,
            question: "What is CryptoKitties?",
            answer: "<p>CryptoKitties is a game centered around breedable, collectible, and oh-so-adorable creatures we call CryptoKitties! Each cat is one-of-a-kind and 100% owned by you; it cannot be replicated, taken away, or destroyed.</p>"
        }, {
            id: 4,
            question: "Whats the big deal about CryptoKitties?",
            answer: "<p>CryptoKitties is one of the worlds first games to be built on blockchain technologythe same breakthrough that makes things like Bitcoin and Ethereum possible. Bitcoin and ether are cryptocurrencies but CryptoKitties are cryptocollectibles. You can buy, sell, or trade your CryptoKitty like it was a traditional collectible, secure in the knowledge that blockchain will track ownership securely.</p><p>But, unlike traditional collectibles, you can breed two CryptoKitties to create a brand-new, genetically unique offspring. It results in something specialjust like you!</p>"
        }, {
            id: 2,
            question: "Woah, slow down Mr. Scientist  describe CryptoKitties in words that make sense to me",
            answer: "<p>Think breedable Beanie Babies.</p>"
        }, {
            id: 3,
            question: "So theyre digital toys that are D.T.F.?",
            answer: "<p>A toy built with emerging technology, the groundbreaking concept of digital scarcity, and a genetic algorithm, but surelets summarize them with a crude acronym.</p>"
        }, {
            id: 4,
            question: "Does it cost money to play CryptoKitties?",
            answer: "<p>Unless you are an early access user (they get a free CryptoKitty), yes.</p>"
        }]
    }, {
        id: 3,
        title: "Buying and selling",
        questions: [{
            id: 1,
            question: "How do I get a CryptoKitty?",
            answer: "<p>Go to the Marketplace and look at the CryptoKitties for sale, or breed two CryptoKitties together.</p>"
        }, {
            id: 2,
            question: "How do I sell or breed CryptoKitties?",
            answer: "<p>Your CryptoKittys profile page has two buttons below its name for selling or breeding it.</p>"
        }, {
            id: 3,
            question: "How much does it cost to buy a CryptoKitty?",
            answer: "<p>Theres no standard price for CryptoKitties. Users set their own starting price when they sell their Kitty, and the price goes down until the auction ends or the Kitty is purchased by another user.</p><p>The CryptoKitties team releases a new Gen 0 CryptoKitty every fifteen minutes (up until November 2018). The starting price of Gen 0 CryptoKitties is determined by the average price of the last five CryptoKitties that were sold, plus 50%.</p><p>Note that you need to use ether to purchase CryptoKitties.</p>"
        }, {
            id: 4,
            question: "How many CryptoKitties do I need to get started?",
            answer: "<p>Just one! However, we recommend starting with two so that you can start breeding them together.</p>"
        }, {
            id: 5,
            question: "Why is it so complicated to get started with CryptoKitties?",
            answer: "<p>CryptoKitties is built on blockchain technology, which is relatively new stuff. Its safe and secure, but its going to be a little complicated until the rest of the world cat-ches up.</p>"
        }, {
            id: 6,
            question: "Whats ether (ETH)? Why do I need it to play CryptoKitties?",
            answer: "<p>Ether powers the Ethereum network, which is what CryptoKitties is built on. Ether acts like any other currency; the value fluctuates with the market.</p><p>You need to convert your currency (e.g. USD, CAD, GBP, etc.) into ether to pay for things on our network.</p>"
        }]
    }, {
        id: 4,
        title: "Breeding",
        questions: [{
            id: 1,
            question: "Cant you just create new CryptoKitties?",
            answer: '<p>Not exactly. Blockchain technology prevents us from tampering with the ecosystem we built, which protects your CryptoKitty from artificial inflation or the digital collectible equivalent of insider trading.</p><p>Once all the "Gen 0" CryptoKitties are gone, theres no way for us to add more.</p>'
        }, {
            id: 2,
            question: "Is my CryptoKitty a dame or a sire? A boy or a girl? A dad or a mom?",
            answer: "<p>Its the 21st century; lets ease up on the labels.</p><p>Every CryptoKitty can play the role of Dame (i.e. mother) or Sire (i.e. father). However, a CryptoKitty can only be one at a time. For example, your Dame cant Sire while theyre expectingand vice versa.</p>"
        }, {
            id: 3,
            question: "How do I breed my Kitties together?",
            answer: "<p>Start by choosing one of your CryptoKitties to be the Sire (i.e. the dad). Then you can choose one of your other CryptoKitties to be the mom.</p><ul><li>Go to My Kitties</li><li>Select the Kitty who will act as Sire</li><li>Press the breeding button</li><li>Choose one of your other Kitties to be the mom</li><li>Approve the ether transaction</li></ul><p>You can expect a new Kitty to appear in My Kitties soon!</p>"
        }, {
            id: 4,
            question: "How do I breed with other users Kitties?",
            answer: "<p>Start by finding the CryptoKitty you want to act as the Sire (i.e. the dad) and make sure you have the ether to pay their siring fee. Then choose one of your Kitties to act as the mom.</p><ul><li>Go to Marketplace</li><li>Select Siring</li><li>Pick the cat you want to act as Sire</li><li>Click Breed now</li><li>Select one of your Kitties to be the mom</li><li>Click Okay, give them some privacy</li><li>Approve the ether transaction</li></ul><p>You can expect a new Kitty to appear in My Kitties soon!</p>"
        }, {
            id: 5,
            question: "How often can I breed CryptoKitties?",
            answer: "<p>A CryptoKitty cant breed while its expecting offspring or recovering from siring. Each time a CryptoKitty breeds, its cooldown period will increase. Later generation offspring will also have a naturally longer cooldown period.</p><p>Each CryptoKittys cooldown period is displayed on their bio page.</p>"
        }, {
            id: 6,
            question: "What is gas? And why does breeding cost me GWEI/ETH?",
            answer: "<p>Gas is a shorthand used to describe the cost of powering a transaction or contract in Ethereum, which is the blockchain network that CryptoKitties is built on.</p><p>Because blockchain is decentralized, every transaction is distributed through multiple computers, not a central server. This ensures each token  in this case, each CryptoKitty  is secure and one-of-a-kind. However, it also takes more computational power, which is covered by the cost of gas. Ethereum typically communicates this cost in gwei (1 billion gwei = 1 ether/ETH).</p>"
        }, {
            id: 7,
            question: "How many CryptoKitties are there?",
            answer: "<p>We released hundreds of CryptoKitties when we launched. Until November 2018, a new CryptoKitty is released approximately every 15 minutes&mdash;we call these parentless Kitties Gen 0 CryptoKitties. Once all the Gen 0 Kitties are gone, the only way to get a new CryptoKitty is to breed two together or to buy one from another user on the marketplace.</p><p>However, through breeding, there are a nearly unlimited possible number of possible CryptoKitties that can be created.</p>"
        }, {
            id: 8,
            question: "What makes each CryptoKittys genes work? I want to breed a certain kind of cat...",
            answer: "<p>Each CryptoKitty has a probabilistically unique genetic combination that affects not only what it looks like, but what its offspring look like.</p><p>Basically, each CryptoKitty isnt just composed of what you can see, but also a variety of traits that can only be found through breeding. Certain genetic combinations can unlock an ascensiona whole new characteristic!</p><p>For example, a green eyed cat and a blue eyed cat might unlock a purple eyed cat  (NOTE: This example isnt true, but the concept is).</p>"
        }]
    }, {
        id: 5,
        title: "Fancy cats",
        questions: [{
            id: 1,
            question: "What are Fancy Cats?",
            answer: "<p>Fancy Cats are a super special kind of CryptoKitty with custom art. Fancy Cats are fostered by real people, so if you see Chairman Meow, Feline Musk, or Kitty Perry on the marketplace, be sure to thank your favourite celebrity for making it possible.</p>"
        }, {
            id: 2,
            question: "How do you breed a Fancy Cat?",
            answer: "<p>Creating certain ascensionsa new characteristic that emerges from breeding two CryptoKitties togethercan lead to Fancy Cats. However, just because you figure out the characteristics that need to be bred together to result in a Fancy Cat does not mean one will be guaranteed to be born. It may take a few tries to get the offspring youre after!</p>"
        }]
    }, {
        id: 6,
        title: "Other",
        questions: [{
            id: 1,
            question: "Can you recover my lost CryptoKitties? I cant access my MetaMask wallet...",
            answer: "<p>Unfortunately, no.</p><p>If you lose access to your MetaMask wallet, we cannot recover your cats. Its not an issue of it being against our policy or difficulty; it is simply not possible.</p><p>Our smart contracts secure each CryptoKitty so that the developers cant edit, access, or reassign them. This protects your Kitties from hackers and anyone else who would steal them. Unfortunately, it also means we cant simply recover any CryptoKitties you lose.</p>"
        }, {
            id: 2,
            question: "Why cant I see my sale or siring auction in Etherscan?",
            answer: "<p>Payments for sales and auctions are called internal transactions in Etherscan. They have their own tab.</p>"
        }, {
            id: 3,
            question: "Is this a scam?",
            answer: "<p>No, this isnt a scam. Anyone with insider knowledge of CryptoKittiesincluding our developersare banned from participating. This is to prevent anyone from using their knowledge of the breeding algorithm to create the most valuable kinds of cat.</p>"
        }, {
            id: 4,
            question: "Are CryptoKitties like Bitcoin?",
            answer: "<p>CryptoKitties are NOT a cryptocurrency. Theyre more like a cryptocollectible. The real-world analogy for a cryptocurrency is dollars or pounds; a cryptocollectibles real world analogy is closer to assets like baseball cards or fine art.</p><p>As dictated by the smart contract, any CryptoKitty you own belongs to you. Like any product or property you can own, the market price is determined by demand, scarcity, and your asking price.</p>"
        }, {
            id: 5,
            question: "Can I use a Credit Card to play CryptoKitties?",
            answer: "<p>Not yet; the technology simply isnt there yet. However, as soon as it is, we plan to support it.</p><p>For now, services like Coinbase allow you to buy ether with a credit card.</p>"
        }, {
            id: 6,
            question: "Can I play CryptoKitties with my phone?",
            answer: "<p>Not yet. CryptoKitties relies on technologies that simply dont function on mobile devices, like MetaMask.</p><p>We are developing a mobile app that offers some fun features, but you will need a laptop, desktop, or tablet browser to complete transactions for the foreseeable future.</p>"
        }, {
            id: 7,
            question: "How are you making money with CryptoKitties?",
            answer: "<p>When you buy a Gen 0 catwhich are released every 15 minuteswe get that income. Otherwise, we take 3.75% from each transaction on our marketplace.</p><p>Note that we made the marketplace to make our game as easy as possible to use. Its possible to do whatever you want with your cats outside of our marketplace without paying us a cent.</p>"
        }, {
            id: 8,
            question: "How do I reach the CryptoKitties team regarding a project, partnership, or investment opportunity?",
            answer: '<p>CryptoKitties was developed by <a class="u-link-text" href="https://www.axiomzen.co" target="_blank">Axiom Zen</a>, a venture studio. <a class="u-link-text" href="https://www.axiomzen.co/contact" target="_blank">Give us the details here</a> and well be in touch.</p>'
        }]
    }]
